  true,\n\t\"url\": null,\n\t\"notes\": \"Schedule Sales Query presents sales volume
  figures as reported to GSA by contractors. The reports are generated as quarterly
  reports for the current year and the past five fiscal years. The sales data reported
  here are updated as contractors' reports are received, but the data may not be up
  to date as adjustments can be received at any time. The information on this site
  mirrors the data used by GSA for contract administration and fee management. It
  is not the official source of sales data. This data should be used for informational
  purposes only.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
